import React, { Component } from 'react'

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="Card">
        <div>{this.props.Title}</div>
        <div>{this.props.intro}</div>
        <div></div>
      </div>
    );
  }
}

export default Card;
